import React from 'react';
import './Components/Jumbotron.css'
import './App.css'

const Home = () => {
    return (
        <div>
            <div className="card-panel blue lighten-2 outer">
                <div className="container">
                    <h1><i class="medium material-icons prefix">school</i> Exam-Help</h1>
                    <p>Always there in the times of need...</p>
                </div>
            </div>
            {/* <h3 className="container indigo-text text-darken-4">You get all this !!</h3> */}
            <section className="container section" id="photos">
                <div className="row">
                    <div className="col s12 l4">
                        <img class="responsive-img z-depth-4 ht" src="data:image/jpeg;base64," alt="not found" />
                    </div>
                    <div className="col s12 l6 offset-l1">
                        <h2 className="indigo-text text-darken-4">Schedule</h2>
                        <p className="flow-text">We maintain a schedule for your upcoming tests</p>
                    </div>
                </div>
                <div className="row">
                    <div className="col s12 l4 push-l8 ">
                        <img class="responsive-img z-depth-4 ht" src="data:image/jpeg;base64," alt="not found" />
                    </div>
                    <div className="col s12 l6 offset-l1 pull-l5 right-align">
                        <h2 className="indigo-text text-darken-4">Results</h2>
                        <p className="left-align flow-text">Get your results with option to see how you did in comparison to your classmates.</p>
                    </div>
                </div>
                <div className="row">
                    <div className="col s12 l4">
                        <img class="responsive-img z-depth-4 ht" src="data:image/jpeg;base64," alt="not found" />
                    </div>
                    <div className="col s12 l6 offset-l1">
                        <h2 className="indigo-text text-darken-4">Create Test</h2>
                        <p className="flow-text">Design your own test easily. We have multiple templates you can chose from to make your test building experience better.</p>
                    </div>
                </div>
            </section>
        </div>
    )
}

export default Home;